/*Table structure for table `data_server` */

DROP TABLE IF EXISTS `data_server`;

CREATE TABLE `data_server` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '아이디',
  `name` text DEFAULT NULL COMMENT '이름',
  `server_type` varchar(16) DEFAULT NULL COMMENT '서버유형 (DB, MCI, EAI, FHIR)',
  `connection_type` varchar(16) DEFAULT NULL COMMENT '연결유형 (socket, http, db)',
  `request_format` varchar(16) DEFAULT NULL COMMENT '요청포맷 (json, xml, db)',
  `request_protocol` varchar(16) DEFAULT NULL COMMENT '요청프로토콜 (MCI, http, db)',
  `response_format` varchar(16) DEFAULT NULL COMMENT '응답포맷 (json, xml, db)',
  `response_protocol` varchar(16) DEFAULT NULL COMMENT '응답프로토콜 (MCI, http, db)',
  `server_url` text DEFAULT NULL COMMENT '서버 URL',
  `request_template` text DEFAULT NULL COMMENT '요청 템플레이트',
  `request_mapping` text DEFAULT NULL COMMENT '요청 매핑 (JSON 포맷)',
  `response_mapping` text DEFAULT NULL COMMENT '응답 매핑 (JSON 포맷)',
  `create_date` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT '작성일',
  `modify_date` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT '수정일',
  `create_author` varchar(16) DEFAULT NULL COMMENT '작성자',
  `modify_author` varchar(16) DEFAULT NULL COMMENT '수정자',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='서버 연동 정보';

