  `modify_date` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT '수정일',
  `create_author` varchar(16) DEFAULT NULL COMMENT '작성자',
  `modify_author` varchar(16) DEFAULT NULL COMMENT '수정자'
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='단말 정보';

